import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import icon from '../pages/img/icon.jpg';

const EditProfile = () => {
    const [image] = useState(icon);
    const [errors, setErrors] = useState([]);

    const handleImageClick = () => {
        document.getElementById('file-input').click();
    };

    const navigate = useNavigate();

    const returnHome = () => {
        navigate('/home'); 
    };

    const validatePassword = (password) => {
        const minLengthPattern = /.{8,}/; 
        const upperCasePattern = /[A-Z]/; 
        const specialCharPattern = /[!@#$%^&*()_+{}\[\]:;"'<>,.?/\\|`~]/;

        return minLengthPattern.test(password) &&
               upperCasePattern.test(password) &&
               specialCharPattern.test(password);
    };

    const handleEdit = async (event) => {
        event.preventDefault(); 

        let errors = [];

        const email = document.getElementById('email').value;
        const newPass = document.getElementById('newPass').value;
        const confirmNewPass = document.getElementById('confirmNew').value;
        const oldPass = document.getElementById('oldPass').value;

        const emailPattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

        if (newPass !== confirmNewPass) {
            errors.push('New passwords do not match.');
        }

        if (email.length === 0 || newPass.length === 0 || confirmNewPass.length === 0 || oldPass.length === 0) {
            errors.push('All fields are required.');
        }

        if (!emailPattern.test(email)) {
            errors.push('Invalid email address.');
        }

        if (!validatePassword(newPass)) {
            errors.push('Password must be at least 8 characters long, include one uppercase letter, and one special character.');
        }

        setErrors(errors);

        if (errors.length === 0) {
            try {
                const response = await fetch('/api/users/profile', {
                    method: 'PATCH',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${localStorage.getItem('token')}` // Assuming you are using JWT for authentication
                    },
                    body: JSON.stringify({
                        email,
                        password: newPass,
                    }),
                });
                const result = await response.json();

                if (response.ok) {
                    navigate('/home'); // Redirect after successful update
                } else {
                    setErrors([result.error]);
                }
            } catch (error) {
                console.error('Error updating profile:', error);
                setErrors(['Failed to update profile.']);
            }
        }
    };


    return (
        <div className="edit-container">
            <div className="edit-content">
                <div className="image-container">
                    <img src={image} alt="Profile" />
                </div>
                <form className="edit-info" onSubmit={handleEdit}>
                    <input id="file-input" type="file" style={{ display: 'none' }} />
                    <label htmlFor='email'>Email</label>
                    <input type="text" className='email' id='email' />
                    <label htmlFor='newPass'>New Password</label>
                    <input type="password" className='newPass' id='newPass' />
                    <label htmlFor='confirmNew'>Confirm New Password</label>
                    <input type="password" className='confirmNew' id='confirmNew' />
                    <hr/>
                    <label htmlFor='oldPass'>Confirm Old Password</label>
                    <input type="password" className='oldPass' id='oldPass' />
                    <div className="button-container">
                        <button type="submit" className="submit-button">Save Changes</button>
                        <button type="button" className="cancel-button" onClick={returnHome}>Cancel</button>
                    </div>
                    {errors.length > 0 && (
                        <div className="error-messages">
                            {errors.map((error, index) => (
                                <p key={index} className="error">{error}</p>
                            ))}
                        </div>
                    )}
                </form>
            </div>
        </div>
    );
}

export default EditProfile;
